import React, { useState } from "react";
import {
  Text,
  Box,
  Accordion,
  Flex,
  ColorPicker,
  Input,
  Stack,
  Slider,
} from "@mantine/core";
import { IconPlus } from "@tabler/icons-react";

const CategoryCustomize = ({ selectedAppBarItem }) => {
  const [boxValue, setBoxValue] = useState(1);
  const [paddingValue, setPaddingValue] = useState(1);
  const [marginValue, setMarginValue] = useState(1);

  // Define functions to update the customization options
  const handleRadiusChange = (newValue) => {
    setBoxValue(newValue);
  };

  const handlePaddingChange = (newValue) => {
    setPaddingValue(newValue);
  };

  const handleMarginChange = (newValue) => {
    setMarginValue(newValue);
  };

  // Update the customization options based on the selectedAppBarItem
  React.useEffect(() => {
    if (selectedAppBarItem === "Appbar") {
      // Customize the Appbar item here
      // You can set initial values for boxValue, paddingValue, and marginValue
    } else {
      // Handle other selected items
    }
  }, [selectedAppBarItem]);

  return (
    <Box
      m="xs"
      h="470px"
      bg="gray.2"
      style={{ borderRadius: "10px", overflowY: "auto" }}
    >
      {/* Accordion */}
      <Accordion
        m="xs"
        variant="contained"
        defaultValue="category-item"
        pb={10}
      >
        {/* Accordion.Item */}
        <Accordion.Item value="category-item">
          {/* Accordion.Control */}
          <Accordion.Control bg="#FFFFFF">
            <Text>Category Item</Text>
          </Accordion.Control>
          {/* Accordion.Panel */}
          <Accordion.Panel bg="#FFFFFF">
            <Flex direction="column">
              <Text mt="xs">Background Color</Text>
              <ColorPicker mt="xs" w="auto" size="lg" format="rgba" />
            </Flex>
            <Stack gap={0}>
              {/* Box Radius */}
              <Text size="sm">Box Radius</Text>
              <Flex
                mih={40}
                bg="white"
                gap="xs"
                justify="center"
                align="center"
                direction="row"
                wrap="wrap"
                style={{
                  border: "1px solid #1b1c1b",
                  borderRadius: "5px",
                }}
              >
                <Input
                  type="number"
                  size="xs"
                  value={boxValue}
                  w={45}
                  onChange={(e) => handleRadiusChange(e.target.value)}
                  style={{ borderRadius: "20px" }}
                />
                <Slider
                  value={boxValue}
                  onChange={handleRadiusChange}
                  min={0}
                  max={100}
                  w={160}
                  label={null}
                />
                <IconPlus
                  onClick={handleRadiusChange}
                  style={{
                    border: "1px solid #000",
                    borderRadius: "50%",
                    cursor: "pointer",
                  }}
                />
              </Flex>
              {/* Padding */}
              <Text size="sm">Padding</Text>
              <Flex
                mih={40}
                bg="white"
                gap="xs"
                justify="center"
                align="center"
                direction="row"
                wrap="wrap"
                style={{
                  border: "1px solid #1b1c1b",
                  borderRadius: "5px",
                }}
              >
                <Input
                  type="number"
                  size="xs"
                  value={paddingValue}
                  w={45}
                  onChange={(e) => handlePaddingChange(e.target.value)}
                  style={{ borderRadius: "20px" }}
                />
                <Slider
                  value={paddingValue}
                  onChange={handlePaddingChange}
                  min={0}
                  max={100}
                  w={160}
                  label={null}
                />
                <IconPlus
                  onClick={handlePaddingChange}
                  style={{
                    border: "1px solid #000",
                    borderRadius: "50%",
                    cursor: "pointer",
                  }}
                />
              </Flex>
              {/* Margin */}
              <Text size="sm">Margin</Text>
              <Flex
                mih={40}
                bg="white"
                gap="xs"
                justify="center"
                align="center"
                direction="row"
                wrap="wrap"
                style={{
                  border: "1px solid #1b1c1b",
                  borderRadius: "5px",
                }}
              >
                <Input
                  type="number"
                  size="xs"
                  value={marginValue}
                  w={45}
                  onChange={(e) => handleMarginChange(e.target.value)}
                  style={{ borderRadius: "20px" }}
                />
                <Slider
                  value={marginValue}
                  onChange={handleMarginChange}
                  min={0}
                  max={100}
                  w={160}
                  label={null}
                />
                <IconPlus
                  onClick={handleMarginChange}
                  style={{
                    border: "1px solid #000",
                    borderRadius: "50%",
                    cursor: "pointer",
                  }}
                />
              </Flex>
            </Stack>
          </Accordion.Panel>
        </Accordion.Item>
      </Accordion>
    </Box>
  );
};

export default CategoryCustomize;
